%jdbc(hive)

DROP TABLE  sandbox_datascientist.jfp_nuevas_altas_2g_i0;
CREATE TABLE sandbox_datascientist.jfp_nuevas_altas_2g_i0 stored as ORC as

select a.*, FROM_UNIXTIME(UNIX_TIMESTAMP(case when b.tipo_oferta_de in ('PR_PPAL_CONTRATO', 'Postpago') then b.fecha_alta
when b.tipo_oferta_de in ('PortePagado', 'PR_PPAL_ACTIVA', 'PR_PPAL_EXPRESS', 'Prepaid', 'PRE') then b.Primera_Recarga_FE else b.fecha_alta end,'yyyy-MM-dd'), 'yyyyMM') mes
from sandbox_datascientist.ep_A2G_anis2gonly_i4_solapa4 a
left join sandbox_datascientist.jfp_abt_suscripcion_movil_m b on a.ani=b.valor_recurso_primario_cd and a.periodo_nr=b.periodo_nr;

DROP TABLE  sandbox_datascientist.jfp_nuevas_altas_2g_i1;
CREATE TABLE sandbox_datascientist.jfp_nuevas_altas_2g_i1 stored as ORC as

select mes, count(distinct ani)
from sandbox_datascientist.jfp_nuevas_altas_2g_i0 a
where mes is >=202101
group by mes;
